        // Deploy tokens
        usdc = new MockUSDC();
        cbBtc = new MockCbBTC();

        // Deploy infrastructure
        aavePool = new MockAavePool();
        swapRouter = new MockSwapRouter();

        emit Deployed(
            address(usdc),
            address(cbBtc),
            address(aavePool),
            address(swapRouter)
        );
    }

    /**
     * @dev Initializes all contracts with required settings and liquidity
     */
