        require(address(usdc) != address(0), "Deploy contracts first");

        // Mint initial tokens for liquidity
        usdc.mint(address(this), INITIAL_USDC_LIQUIDITY);
        cbBtc.mint(address(this), INITIAL_BTC_LIQUIDITY);

